webpackJsonp([0x9d4c93999625],{4061:function(n,p){n.exports={data:{markdownRemark:{html:'<p>東方弾幕風フレームワークライブラリ『<a href="/tag/flan">Framework of LunAtic Notation</a>』のバージョン0.1dをリリースしました。今回は主にバグ修正のみの更新となります。</p>\n<h2>(拍)新作情報が2005/06になっ てるよ</h2>\n<p>ﾋｷﾞｨ！ 修正完了です。</p>\n<h2>(拍)夏コミお疲れ様でした！ポスターいっぱいの弾幕写真につい惹かれて買ってしまいましたが、～</h2>\n<p>ありがとうございます。きっと完全版にはあれの倍くらいの弾幕が実装されますのでﾜｸﾃｶして待っていただければ吉。</p>\n<h2>(拍)時封城の原画見せてもらいましたがv1とv2でぜんぜん違いますね。～</h2>\n<p>まだまだ、上には上がいまくるもんで（ｒｙ</p>\n<h2>(拍)時封城と夢終劇に出てくるリリーをヒーリングリリーにしてください。</h2>\n<p>はぅっ、それは…その…</p>\n<h2>(拍)夢終劇だけでもいいのでヒーリングリリー出してもらえませんか。</h2>\n<p>あ、新作のケーキ、美味しそう！このケーキの最小単位は合成1UPキノコと合成生クリームね。</p>\n<h2>(拍)時封城v2は公式の差し替えキットみたいな感じになるんですか？</h2>\n<p>ちょっと違います。 システム内部的には設計の根底からひっくり返りますし、表面上でも結構規格が異なったりしますし。そのため一部の時封城v1差し替えキットは大変申し訳ないですが修正が必要になる場合があります。</p>\n<h2>(拍)～確か時封城の時に「弾幕風で本家に匹敵する物を作る」っていう目標は達成したって言ってませんでしたっけ</h2>\n<p>それと同時に同人レベルとしてはやっとスタートラインに立てたばかりだなぁと思った、ともいったような気がします。あと次々作では弾幕風に戻る、とも。(次作と次々作の順番を入れ替えたので)</p>\n<h2>(拍)FLAN結構難しいです。弾幕風覚え立ての僕でも使いこなせるようになるでしょうか</h2>\n<p>単発ものスクリプトやEXルーミア級のちょっとしたステージ程度では逆にこのシステムを使うのは大げさかもしれません。 例えるならJAVAサーブレットに対しStrutsのような存在で比較的上級者向けフレームワークですが慣れると結構便利に使えるとおもいますよ？</p>\n<h2>(拍)最近クリエ板来なくなりましたね？忙しいんですか？</h2>\n<p>最近ってかもう1年以上2～3ヶ月に1描きくらいのペースになってますね。 2年前は2日に1回くらいのペースで描いてたんですが。</p>\n<h2>(拍)今から幻想郷いくんですが一緒に行きますか？</h2>\n<p>行きます！今すぐお供します！と言うわけで夢終劇スタッフには悪いけど今から神隠ｓ(裁かれました</p>',frontmatter:{cover:null,date:"2006-08-21T21:26:00+09:00",strDate:"2006/8/21",title:"冬コミ申し込んできました"}}},pathContext:{path:"/ja/blog/2006/08/21-冬コミ申し込んできました/",langKey:"ja"}}}});
